import React from "react";
import { Link } from "react-router-dom";
const DUMMY_EVENTS = [
  { id: "e1", title: "e1" },
  { id: "e2", title: "e2" },
];
const EventsPage = () => {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
